import React from 'react';

function Main() {  
  return (
    <main className="content">
        <section className="profile" aria-label="Профиль">
          <img className="profile__image" src="#" alt="Аватар" />
          <button className="profile__avatar-button" type="button" />
          <div className="profile__info">
            <h1 className="profile__info-title"> </h1>
            <button className="profile__edit-button" type="button" />
            <p className="profile__info-subtitle" />
          </div>
          <button className="profile__add-button" type="button" />
        </section>
        <section className="elements" aria-label="Карточки мест"></section>
      </main>
  );
}

export default Main;
